{-# LANGUAGE GADTs, ScopedTypeVariables #-}
-- | This module performs some regression testing to make sure that consensus critical items, just as jet CMR don't change.
module Simplicity.Elements.Regression (tests) where

import Data.Foldable (length, toList)
import Lens.Family2 (review, over)

import Test.Tasty (TestTree, testGroup)
import Test.Tasty.HUnit (Assertion, (@?=), assertBool, testCase)

import Simplicity.CoreJets
import Simplicity.Digest
import Simplicity.Elements.Jets as Elements
import Simplicity.MerkleRoot
import Simplicity.Serialization
import Simplicity.Tree
import Simplicity.Ty
import Simplicity.Ty.Word
import qualified Simplicity.Word as Word

tests :: TestTree
tests = testGroup "Regression"
        [ testCase "jet count" assert_jet_count
        , assert_jet_cmrs
        ]

wordJets :: BinTree (SomeArrow JetType)
regularJets :: BinTree (SomeArrow JetType)
(Branch wordJets regularJets) = treeEvalBitStream Elements.getJetBit

assert_jet_count :: Assertion
assert_jet_count = length regularJets @?= 471

assert_jet_cmr :: (TyC a, TyC b) => JetType a b -> Assertion
assert_jet_cmr jt = commitmentRoot (asJet jt) @?= review (over be256) (expected_cmr jt)

assert_jet_cmrs :: TestTree
assert_jet_cmrs = testGroup "CMRs" [testCase (show jt) (assert_jet_cmr jt) | SomeArrow jt <- someWordJets ++ (toList regularJets)]
  where
   someWordJets = take 6 (toList wordJets)

